import React from "react";
import { BrowserRouter, Link, Route, Switch } from "react-router-dom";

function Tutorial() {
  return (
    <div>
      intruduction of this app
      <p>
        you can login first, and put your courses, your questions and your
        answers here
      </p>
    </div>
  );
}

class HomepageGuide extends React.Component() {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <ul>
        <li>
          <Link to="/">HomePage</Link>
        </li>
        <li>
          <Link to="/my_account">My Account</Link>
        </li>
        <li>
          <Link to="my_courses">My courses</Link>
        </li>
      </ul>
    );
  }
}

export default class Home extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <>
        <div>
          <header>Home Page</header>
        </div>
        <hr />
        <Tutorial />
      </>
    );
  }
}
